import React, { Component, useState, useEffect } from 'react';

function Like() {
    const [liked, setLiked] = useState(null);
    liked = false
    useEffect(() => {
        
        document.title = 'Liked? = {liked}';
        return () => {
            
        };
    }, [])


}

export default Like;
